import React, { useEffect, useState } from "react";
import { Table, Button } from "react-bulma-components";
import axios from "../../utils/api";
import "./index.css";

function BookList() {
  const [books, setBooks] = useState([{}]);
  const getBooks = async () => {
    try {
      const res = await axios.get("/books");
      setBooks(res.data);
      console.log(res.data);
    } catch (e) {
      console.log(e);
    }
  };
  const book = {
    name: "Hermes Borba Wanderley",
    age: 28,
    date: new Date(),
  };
  useEffect(() => {
    getBooks();
  }, []);

  return (
    <div>
      <Table color="info">
        <thead>
          <tr>
            <th>Nome</th>
            <th>idade</th>
            <th>Data</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th>{book.name}</th>
            <th>{book.age}</th>
            <th>{book.date.toDateString()}</th>
            <th>
              <Button color="success" className="btn-box">
                Atendido
              </Button>
              <Button color="danger">Faltou</Button>
            </th>
          </tr>
        </tbody>
      </Table>
    </div>
  );
}

export default BookList;
